class Solution:
    def findSubstring(self, s, words):
        idx, word_length = 0, len(words[0])
        initial_letters = set([w[0] for w in words])
        indices = []
        while idx < len(s):
            if s[idx] in initial_letters:
                temp = words.copy()
                count = 0
                j = idx
                while count < len(words) and temp:
                    word = s[j:j+word_length]
                    if word in temp:
                        temp.remove(word)
                    count+=1
                    j += word_length
                    if count == len(words) and not temp:
                        indices.append(idx)
            idx += 1
        return indices

